  \"2016-02-01T20:34:43.027273\",\n\t\"name\": \"family-day-care-homes\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Family day care homes are private family
  homes caring for not more than six children, including the provideru2019s own children
  not in school full time, where the children are cared for not less than three nor
  more than twelve hours during a twenty-four hour period and where care is given
  on a regularly recurring basis, except that care may be provided in excess of twelve
  hours but not more than seventy-two consecutive hours to accommodate a need for
  extended care or intermittent short-term overnight care. During the regular school
  year, a maximum of three additional children who are in school full time, including
  the provideru2019s own children, are permitted, except that if the provider has
  more than three children who are in school full time, all of the provideru2019s
  children are permitted.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
